"use strict";(self.webpackChunkhandbook=self.webpackChunkhandbook||[]).push([[7511],{4524:e=>{e.exports=JSON.parse('{"label":"PM guide","permalink":"/docs/tags/pm-guide","allTagsPath":"/docs/tags","count":1,"items":[{"id":"learning/project management/pm-guide","title":"A Guide to Project Management","description":"A project is a temporary endeavor undertaken to create a unique product, service, or result. It is a set of coordinated and controlled activities with a beginning and an end, designed to achieve specific goals and objectives. Projects are typically used to achieve business goals and objectives, such as increasing revenue, improving efficiency, or developing new products or services.","permalink":"/docs/learning/project management/pm-guide"}]}')}}]);